import React, { Component } from 'react'

export default class FormVadiation extends Component {
    constructor(props) {
        super(props)
        this.state = {
            manv: "",
            tennv: "",
            email: "",
        }
        this.close = React.createRef();
    }
    handleOnChange = () => {
        const { name, value } = event.target;
        this.setState({
      [name]: value,
    });
    }
    render() {
        return (
            <div className="container">
            <h3 className="title">*FormValidation</h3>
            <form>
              <div className="form-group">
                <label>Mã Nhân Viên</label>
                <input type="text" className="form-control" name="manv" />
              </div>
              <div className="form-group">
                <label>Tên Nhân Viên</label>
                <input type="text" className="form-control" name="tennv" />
              </div>
              <div className="form-group">
                <label>Email</label>
                <input type="email" className="form-control" name="email" />
              </div>
              <button type="submit" className="btn btn-success">
                Submit
              </button>
            </form>
          </div>
        )
    }
}
